DROP SCHEMA IF EXISTS cancer;
CREATE SCHEMA cancer;
USE cancer;

DROP TABLE IF EXISTS hospitalranking;

CREATE TABLE hospitalranking (
id integer,
  hospital_name VARCHAR(250)  NOT NULL,
  rank VARCHAR(100)  NULL,
  score VARCHAR(45)  NULL,
  cities VARCHAR(150)  NULL,
  websites VARCHAR(150)  NULL,
  num_rank integer  NULL,
  num_score decimal(15,2)  NULL,
  city_name VARCHAR(150)  NULL,
  state VARCHAR(100)  NULL,
  zipcode decimal(9,0),
  lng float  NULL,
  lat float NULL  ,
      PRIMARY KEY  (id)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;




USE cancer;
DROP TABLE IF EXISTS cancer_rates;
CREATE TABLE cancer_rates (
id integer,
  cancer_site VARCHAR(250)  NOT NULL,
  estimated_new_cases integer null,
  incident_rates decimal (15,2)  NULL,
  estimated_deaths integer NULL,
  mortality_rates float  NULL,
  survival_percent decimal (15,2) NULL,
      PRIMARY KEY  (id) 
)ENGINE=InnoDB DEFAULT CHARSET=utf8;



USE cancer;
drop table if exists cancer_deaths;
CREATE TABLE cancer_deaths (
id integer,
  cancer_type VARCHAR(250)  NOT NULL,
  number_of_deaths integer null,
  percent decimal (15,2)  NULL,
  death_type varchar(100) NULL,
        PRIMARY KEY  (id) 
)ENGINE=InnoDB DEFAULT CHARSET=utf8;



USE cancer;
drop table if exists cancer_vs_other_death_causes;

CREATE TABLE cancer_vs_other_death_causes (
id integer, 
  cancer_type VARCHAR(250)  NOT NULL,
  number_of_deaths integer null,
    death_type varchar(100) NULL,
        PRIMARY KEY  (id) 
)ENGINE=InnoDB DEFAULT CHARSET=utf8;




USE cancer;
drop table if exists cancer_by_gender;
CREATE TABLE cancer_by_gender (
id integer,
  cancer_type VARCHAR(250)  NOT NULL,
  number_of_cancer integer null,
    gender varchar(100) NULL,
        PRIMARY KEY  (id) 
)ENGINE=InnoDB DEFAULT CHARSET=utf8;


USE cancer;
drop table if exists cancer_deaths_gender;
CREATE TABLE cancer_deaths_gender (
id integer,
  cancer_type VARCHAR(250)  NOT NULL,
  number_of_deaths integer null,
    gender varchar(100) NULL,
        PRIMARY KEY  (id) 
)ENGINE=InnoDB DEFAULT CHARSET=utf8;



USE cancer;
drop table if exists cancer_rates_by_gender;
CREATE TABLE cancer_rates_by_gender (
id integer not null,
  site VARCHAR(250)  NULL,
  new_cases integer null,
    incident_rates decimal (18,2) NULL,
    estimated_deaths integer null,
    mortality_rates decimal (18,2),
    survival_rates decimal (18,2),
    gender varchar(200) null,
        PRIMARY KEY  (id) 
)ENGINE=InnoDB DEFAULT CHARSET=utf8;




USE cancer;
drop table if exists us_death_rate;

CREATE TABLE us_death_rate (
id integer not null,
  yr_rate_per_1K integer  NULL,
  heart_disease_percent_total_death decimal (18,2) null,
    cancer_rate_per_1K integer NULL,
    unnamed_3level0_percent_of_deaths decimal (18,2) null,
   unnamed_4level_1 decimal (18,2),
    death_type varchar (50) null,
        over_or_under_65 varchar(50) null,
        PRIMARY KEY  (id) 
)ENGINE=InnoDB DEFAULT CHARSET=utf8;


USE cancer;
drop table if exists national_incidence_trends_gender;
CREATE TABLE national_incidence_trends_gender (
id integer not null,
  cancer_type varchar (100)  NULL,
  cancer_number float null,
    gender varchar (25) NULL,
           PRIMARY KEY  (id) 
)ENGINE=InnoDB DEFAULT CHARSET=utf8;



USE cancer;
drop table if exists new_cancer;
CREATE TABLE new_cancer (
id integer not null,
  cancer_type varchar (100)  NULL,
  cancer_number decimal (18,2) null,
    percentage_of_cancer varchar (25) NULL,
cancergroup varchar(25) NULL,   
        PRIMARY KEY  (id) 
)ENGINE=InnoDB DEFAULT CHARSET=utf8;



USE cancer;
drop table if exists most_common_cancer_by_race;
CREATE TABLE most_common_cancer_by_race (
id integer not null,
 cancer_site varchar (100)  NULL,
 all_races decimal (18,2) null,
 white decimal (18,2) null,
 black decimal (18,2) null,
api decimal (18,2) null,  
ai_an decimal (18,2) null,
historic decimal (18,2) null,
        PRIMARY KEY  (id) 
)ENGINE=InnoDB DEFAULT CHARSET=utf8;





USE cancer;
drop table if exists hospital;
CREATE TABLE hospital (
  idkey integer not null,
  lng float null,
  lat float null ,
  objectid integer,
  id integer, 
  hospital_name VARCHAR(150)  ,
  address VARCHAR(150)  ,
  city VARCHAR(45)  ,
  state VARCHAR(45) ,
  zip integer, 
  zip4 integer,
  telephone VARCHAR(50)  ,
  hospital_type VARCHAR(150)  ,
  hospital_status VARCHAR(10)  ,
  population  integer,
  county VARCHAR(100)  ,
  countyfips  float ,
  country VARCHAR(150)  ,
  latitude float ,
  logitude float , 
  naics_code float ,
  naics_desc VARCHAR(150)  ,
  info_source VARCHAR(250)  ,
  source_date varchar (22), 
  val_method VARCHAR(75)  ,
  val_date varchar(22),
  website VARCHAR(200)  ,
  state_id varchar(100),
  alt_name VARCHAR(150)  ,
  st_fips integer,
  owner_type VARCHAR(200) ,
  ttl_staff integer,
  beds integer,
  trauma VARCHAR(175)  ,
  helipad VARCHAR(5)  ,
   PRIMARY KEY  (idkey)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

